import React from 'react'

const VideoTitle = ({movie}) => {
  return (
    <div className='pt-20 px-10'>
      <h1 className='mb-1'>{movie.original_title}</h1>
      <p className='w-1/3'>{movie.overview}</p>
    </div>
  )
}

export default VideoTitle
